description:
The stork delivers a baby elephant to Mrs Jumbo, veteran of the circus, but the newborn is ridiculed because of his truly enormous ears and dubbed &quot;Dumbo&quot;. Dumbo is relegated to the circus' clown acts; it is up to his only friend, a mouse, to assist Dumbo to achieve his full potential.
